function importHistoricalBondsToSheet() {
  var ss = SpreadsheetApp.getActiveSpreadsheet();
  var sheetName = "Historical Bond Reports";
  var sheet = ss.getSheetByName(sheetName);
  
  if (!sheet) {
    sheet = ss.insertSheet(sheetName);
  } else {
    // Clear existing to avoid appending duplicates if run multiple times
    sheet.clear();
  }
  
  // Set values
  if (HISTORICAL_BOND_DATA.length > 0) {
    var range = sheet.getRange(1, 1, HISTORICAL_BOND_DATA.length, HISTORICAL_BOND_DATA[0].length);
    range.setValues(HISTORICAL_BOND_DATA);
    
    // Format headers
    var headerRange = sheet.getRange(1, 1, 1, HISTORICAL_BOND_DATA[0].length);
    headerRange.setFontWeight("bold");
    headerRange.setBackground("#d9ead3");
    
    // Auto-resize columns
    sheet.autoResizeColumns(1, HISTORICAL_BOND_DATA[0].length);
  }
  
  SpreadsheetApp.getUi().alert("Successfully imported " + (HISTORICAL_BOND_DATA.length - 1) + " historical bond records (deduplicated) to the '" + sheetName + "' tab.");
}
